import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
	logo: {
		position: "relative",
		float: "left",
	},
	navLinks: {
		color: "#f39c12",
	},
	toolBar: {
		display: "flex",
		justifyContent: "center",
	},
}));
